import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import "../css/Courses.css";

function Courses() {
  return (
    <div>
      <Header />
      <section className="coursesMainSection">
        <ul>
          <li>Lägg till ny kurs kopplad till ansvarig lärare</li>
          <li>Lista över lärare man har att välja på som hämtas via API</li>
          <li>
            Spara följande:<li>Namn på kurs</li>
            <li>Utbildningsledare</li>
            <li>Längd på kurs i veckor</li>
            <li>Kursbeskrivning</li>
          </li>
        </ul>
      </section>
      <Footer />
    </div>
  );
}

export default Courses;
